import React from 'react'
import {withStyles} from "@material-ui/styles";
//
import Chip from "./Chips";

const styles={
  root: {
    width:"100%",

    boxSizing: "border-box",
    display:"flex",
    alignItems:"center",
  }
}

function ChipsRow (props) {
  const { classes } = props;
  return(
    <div className={classes.root}>
      <Chip content="+ GMV"/>
      <Chip />
      <Chip />
    </div>
  )
}

export default withStyles(styles)(ChipsRow);
